import React, { useState } from 'react';
import { Link } from "react-router-dom";


//"How it works" in Home Component
const Profiles = () => {
    const [profiles, setProfiles] = useState([
      {
        key_name: "charles",
        profile_image: "https://st3.depositphotos.com/15648834/17930/v/600/depositphotos_179308454-stock-illustration-unknown-person-silhouette-glasses-profile.jpg",
        full_name: "Lars",
        profession: "Developer",
        price: 3
      },
      {
        key_name: "mikey",
        profile_image: "https://i.pinimg.com/564x/d9/56/9b/d9569bbed4393e2ceb1af7ba64fdf86a.jpg",
        full_name: "Mike",
        profession: "UI",
        price: 5
      },
      {
        key_name: "mikey",
        profile_image: "https://st.depositphotos.com/1779253/5140/v/600/depositphotos_51405259-stock-illustration-male-avatar-profile-picture-use.jpg",
        full_name: "Mike",
        profession: "UI",
        price: 5
      },
      {
        key_name: "mikey",
        profile_image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRoX6lhTZKutDXlSB0r6828aCbXuxj91BgHUg&usqp=CAU",
        full_name: "Mike",
        profession: "UI",
        price: 5
      },
      {
        key_name: "mikey",
        profile_image: "https://st3.depositphotos.com/15648834/17930/v/600/depositphotos_179308454-stock-illustration-unknown-person-silhouette-glasses-profile.jpg",
        full_name: "Mike",
        profession: "UI",
        price: 5
      }
    ]);


    const RenderProfiles = (props) => {
        const { profile } = props;

        return (
            <>
              <div className="profile-cont margin-card">
                <Link to={{pathname: `profile/${profile.key_name}`}}>
                  <div className="img-wrapper">
                    <img className="profile-img" alt="pic chosen by profile" src={profile.profile_image} />
                    <div className="new-profile-bottom-label">
                      <div className="bottom-label-inner">
                        <span className="first-row">
                          <p>{profile.full_name}</p>
                        </span>
                        <span className="second-row">
                          <p>{profile.profession}</p>
                          <p>â‚¬{profile.price}</p>
                        </span>
                      </div>
                    </div>
                  </div>
                </Link>
              </div>
            </>
          )
    }

    return (
        <div className="profiles-cont">
          <div className="start-body-wrapper scroll-row">
            <h1 className="h1-title new-profiles-title">
              Current Profiles
            </h1>
            <div className="start-body-inner">
              {profiles.length > 0 && profiles.sort((a, b) => b.id - a.id).map((row, i) => <RenderProfiles key={i} profile={row} />)}
            </div>
          </div>
        </div>
    );
}
export default Profiles;
